def movePolyLineSet(polylineSet):
    newStartX = polylineSet[0][0]
    newStartY = polylineSet[0][1]
    currentStartX = polylineSet[1][0]
    currentStartY = polylineSet[1][1]

    # print("globe:")
    

    for polyline in polylineSet[1:]:
        for i in range(0, len(polyline), 2):
            polyline[i] = round(polyline[i] - currentStartX + newStartX, 5)
            polyline[i+1] = round(polyline[i+1] - currentStartY + newStartY, 5)
        print("    - " + str(polyline))


